import React from "react";
import { Row, Col, Image } from "antd";
import { dummy } from "../../../utils/dummy";

const Story = () => {
  return (
    <div className="story">
      <Row gutter={24}>
        <Col sm={24} lg={6}>
          <div className="story-details">
            <div className="poster">
              <img src={dummy.poster} alt="poster" />
            </div>
            <h2>Becoming</h2>
            <p className="author">by Hawoly Ba</p>
          </div>
        </Col>
        <Col sm={24} lg={18}>
          <div className="story-chapters"></div>
        </Col>
      </Row>
    </div>
  );
};

export default Story;
